package org.tnsif.looping;

public class Patter {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int n=5;
		for(int i=1;i<=n;i++)
		{
			int p=1;
			for(int j=1;j<=n;j++)
			{
				System.out.println(p++ +" ");
			}
			System.out.println("/t");
		}

	}

}
